<script>
import { ref, toRef, computed } from "vue";
import Title from "@/components/atomic/Title.vue";
import { useStore } from "vuex";

export default {
  components: {
    Title,
  },
  setup() {
    const store = useStore();
    const settings = toRef(store.state, "settings");
    const donations = computed(() => {
      let percentage = (
        (parseFloat(settings.value.donations) /
          parseFloat(settings.value.targetdonations)) *
        100
      ).toFixed(0);
      return {
        percentage,
        style: "transform: scaleX(" + percentage / 100 + ")",
        goal: Number(settings.value.targetdonations).toLocaleString("en"),
        current: Number(settings.value.donations).toLocaleString("en"),
      };
    });
    return { donations };
  },
};
</script>
